import React, { useState, useEffect } from 'react';
import { fetchYouTubeRecommendations } from '../youtubeService';

function VideoRecommendations({ symptom }) {
    const [videos, setVideos] = useState([]);
    
    useEffect(() => {
        async function getVideos() {
            const fetchedVideos = await fetchYouTubeRecommendations(symptom);
            console.log(fetchedVideos); 
            setVideos(fetchedVideos); 
        }
        getVideos();
    }, [symptom]); // Fetch videos whenever symptom changes

    return (
        <div>
            <h3>Recommended Videos for {symptom}</h3>
            <div>
                {videos.map(video => (
                    <iframe
                        key={video.id.videoId}
                        width="600" // Set the width to 600px
                        height="335" // Set the height as needed
                        src={`https://www.youtube.com/embed/${video.id.videoId}`}
                        frameBorder="0"
                        allow="accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture"
                        allowFullScreen
                    ></iframe>
                ))}
            </div>
        </div>
    );
}

export default VideoRecommendations;
